import { Box, Button, Grid, Menu } from "@mui/material";

import Menubar from "./Menu";
import { Outlet } from "react-router-dom";
import Home from "./Home";
import { Route, Routes } from "react-router-dom";
import AddSettings from "./Settings";
import BalanceTransactions from "./Transactions";

export default function Watertracker() {

  return (
    <Grid style={{ background: "#e6e8f7" }}>
      <p style={{ textAlign: "left" }}>
        <Menubar />
      </p>
      <Routes>
        <Route path="/" element={<Home />}></Route>
          <Route path="settings" element={<AddSettings/>}></Route>
          <Route path="transactions" element={<BalanceTransactions/>}></Route>
          <Route path="history" element={<History/>}></Route>


      </Routes>
    </Grid>
  );
}
